import { createSlice } from "@reduxjs/toolkit";

const initialCartState = {};

const myCartSlice = createSlice({
  name: "myCart",
  initialState: initialCartState,
  reducers: {},
});

export const myCartActions = myCartSlice.actions;

export default myCartSlice;
